import React from "react";
import { NavLink } from "react-router-dom";
import '../Bootstrap/css/bootstrap.css';

var loadScript = function(src) {
    var tag = document.createElement('script');
    tag.async = false;
    tag.src = src;
    document.getElementsByTagName('root').appendChild(tag);
  }

loadScript('../Bootstrap/js/bootstrap.js')

const Home = () => {

    return(
        <div>
            <NavLink to="./Patient">
                <button type="button" className="btn btn-primary">Patient</button>
            </NavLink>

            <br />
            <NavLink to="./Home">Home</NavLink>
            <br />
            <NavLink to="./Clinician">Clinician</NavLink>
            
            <br></br>
        </div>
    );

};

export default Home;
